"    <div id=\"topicTitle\">",
"     Patient information: Ovarian cysts (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/ovarian-cysts-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H565474936\">",
"      <span class=\"h1\">",
"       What are ovarian cysts?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Ovarian cysts are little sacs of fluid that form on or in a woman&rsquo;s ovary. Each woman has two ovaries, one on each side of her belly. In women who are still having their monthly period, the ovaries release an egg about once a month (",
"      <a class=\"graphic graphic_figure graphicRef80271 \" href=\"mobipreview.htm?14/52/15171\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Ovarian cysts can cause pain or a feeling of pressure in the belly. Or women might not feel them at all. Many women worry about cancer when they learn they have cysts. But most of the time, cysts are nothing to worry about.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H565474943\">",
"      <span class=\"h1\">",
"       What are the symptoms of ovarian cysts?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many women have no symptoms. When symptoms do happen, they can include pain or pressure in the lower belly on one side. The pain can be dull or sharp, and it can come and go.",
"     </p>",
"     <p>",
"      Sometimes, ovarian cysts break open or cause the ovary to twist. This can be a serious problem. Call your doctor right away or go to the emergency room if you feel intense pain in the lower belly on either side. For example, you should go to the emergency room if you have sudden pain that makes you double over or that makes it hard for you to walk. Along with the pain, you might also feel nauseous or throw up, or have light bleeding from your vagina.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H565474950\">",
"      <span class=\"h1\">",
"       What causes ovarian cysts?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are many possible causes of ovarian cysts. The most common causes include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Ovulation or pregnancy",
"        </strong>",
"        &ndash; When an egg is released from the ovary each month, it grows a sac, called a &ldquo;follicle.&rdquo; Sometimes, a follicle grows but does not release an egg and instead forms a cyst. Or, if a woman gets pregnant after the egg is released, a cyst can stay on the ovary for weeks or months. These kinds of cysts usually go away on their own.",
"       </li>",
"       <li>",
"        <strong>",
"         Dermoid cysts",
"        </strong>",
"        &ndash; These are a common type of cyst. They sometimes have teeth, hair, or fat in them. That might sound strange. Dermoid cysts are normally not harmful to your health, but your doctor might want to remove them with surgery.",
"       </li>",
"       <li>",
"        <strong>",
"         Polycystic ovary syndrome (also called PCOS)",
"        </strong>",
"        &ndash; Women with this condition grow many small cysts each month, instead of one big follicle. These cysts usually do not go away and the cysts themselves do not need to be treated or removed. But PCOS does sometimes require treatment for reasons unrelated to the cysts.",
"       </li>",
"       <li>",
"        <strong>",
"         Cancer",
"        </strong>",
"        &ndash; Cancer is the cause of ovarian cysts in less than 1 in 100 cases. Ovarian cancer is most likely to affect women who have stopped having their periods or who have a family history of ovarian cancer.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H565474957\">",
"      <span class=\"h1\">",
"       How big is an ovarian cyst?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some cysts can be 4 inches wide or wider. That&rsquo;s about the size of a large orange. Others are much smaller.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H565474964\">",
"      <span class=\"h1\">",
"       Is there a test for ovarian cysts?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Common tests include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Imaging tests &ndash; The most common kind is a pelvic ultrasound. This test uses sound waves to make a picture of your uterus and ovaries. The pictures can show if you have cysts. It can also show where they are and how big they are. Your doctor might also take pictures with an MRI or a CT scan.",
"       </li>",
"       <li>",
"        Blood tests to check for pregnancy or the possibility of cancer",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H565474971\">",
"      <span class=\"h1\">",
"       How are ovarian cysts treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on what is causing your cysts and what your symptoms are. Possible treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Waiting &ndash; Your doctor might want to do an ultrasound every couple of months. Your cysts might stay the same size, get smaller, or even go away. In those cases, you usually don&rsquo;t need to do anything to treat them.",
"       </li>",
"       <li>",
"        Birth control pills &ndash; This medicine can stop some types of new cysts from growing.",
"       </li>",
"       <li>",
"        Surgery to remove a cyst or the whole ovary",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H565474978\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on what is causing your ovarian cysts. Many women with cysts are able to get pregnant. Even women with just one ovary can often get pregnant. If you can&rsquo;t get pregnant, medicines or new technologies can help. Talk to your doctor if you want to have a baby.",
"     </p>",
