"    <li class=\"plainItem\">",
"     <a class=\"medical medical_patient\" href=\"mobipreview.htm?29/46/30437?source=related_link\">",
"      Patient information: Polycystic ovary syndrome (PCOS) (Beyond the Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?27/29/28115?source=related_link\">",
"      Patient information: Polycystic ovary syndrome (The Basics)",
