"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?38/27/39352/abstract/1\">",
"      Appel GB, Cohen DJ, Pirani CL, et al. Long-term follow-up of patients with lupus nephritis. A study based on the classification of the World Health Organization. Am J Med 1987; 83:877.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?38/27/39352/abstract/2\">",
"      Ortega LM, Schultz DR, Lenz O, et al. Review: Lupus nephritis: pathologic features, epidemiology and a guide to therapeutic decisions. Lupus 2010; 19:557.",
"     </a>",
