var title_f38_27_39356="Dyspareunia differential dx2";
var content_f38_27_39356=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F70497&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F70497&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnoses for physical causes of dyspareunia (cont.)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Location affected",
"       </td>",
"       <td class=\"subtitle1\">",
"        Specific condition",
"       </td>",
"       <td class=\"subtitle1\">",
"        Important history",
"       </td>",
"       <td class=\"subtitle1\">",
"        Source of dyspareunia",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments and Caveats",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"10\">",
"        Vestibule and vagina",
"       </td>",
"       <td>",
"        Atrophy: low or absent estrogen",
"       </td>",
"       <td>",
"        Dryness, irritation, hx breast feeding, oligo/amenorrhea, low",
"estrogen/high androgenic OCP, Depo-Provera, anorexia, exercise,",
"premenopausal tamoxifen, chemotherapy, radiation, BSO, aromatase",
"inhibitors",
"       </td>",
"       <td>",
"        Reduction in labial size, mucosal color and textural change, fissures; elevated vaginal pH, atrophic wet prep",
"       </td>",
"       <td>",
"        Can occur at any age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vulvovaginitis: Candida albicans",
"       </td>",
"       <td>",
"        Antibiotics, steroids, estrogen, immunosuppression",
"       </td>",
"       <td>",
"        Itching, erythema, edema, discharge, fissures; or few sx",
"       </td>",
"       <td>",
"        Look for superimposed vestibulitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Desquamative inflammatory",
"       </td>",
"       <td>",
"        Irritative sx, profuse discharge",
"       </td>",
"       <td>",
"        Erythema, sheets of wbc, parabasals, no lactobacilli",
"       </td>",
"       <td>",
"        Atypical pap. Look for vestibulodynia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vulvovaginitis: Trichomonas",
"       </td>",
"       <td>",
"        Itching, discharge, or few sx",
"       </td>",
"       <td>",
"        Mobile trichomonads; positive culture",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bartholin cyst or abscess",
"       </td>",
"       <td>",
"        Swelling and pain",
"       </td>",
"       <td>",
"        Cystic mass at base of vestibule",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Seminal plasma allergy",
"       </td>",
"       <td>",
"        Itching on entry or ejaculation",
"       </td>",
"       <td>",
"        Edema and erythema post coitus",
"       </td>",
"       <td>",
"        Trial of condom helps",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dermatosis: lichen sclerosus",
"       </td>",
"       <td>",
"        Itching or no symptoms",
"       </td>",
"       <td>",
"        Fissures, scaring around introitus",
"       </td>",
"       <td>",
"        Candida, vulvodynia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dermatosis: lichen planus",
"       </td>",
"       <td>",
"        Itching, burning, discharge",
"       </td>",
"       <td>",
"        Erosions, ulceration, scarring",
"       </td>",
"       <td>",
"        As above, atypical Pap smear",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inadequate lubrication, dryness",
"       </td>",
"       <td>",
"        Poor sexual technique, sexual dysfunction, Sjogren's, OCP, medications, vestibulodynia",
"       </td>",
"       <td>",
"        Dryness, tenderness",
"       </td>",
"       <td>",
"        No good test; hard to judge on exam; history important",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Radiation",
"       </td>",
"       <td>",
"        History of gyn or urinary tumor",
"       </td>",
"       <td>",
"        Pallor, loss of elasticity, scarring",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     OCP: oral contraceptive pills; BSO: bilateral salpingo-oophorectomy; hx: history; sx: symptoms.",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Elizabeth Gunther Stewart, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
